const ajiData = [
  {
    id: "audio1",
    data: "data:audio/mpeg;base64,",
  },
  {
    id: "audio2",
    data: "data:audio/mpeg;base64,",
  },
];

let count = 0;

async function loop() {
  if (count == 0 || count == 90) {
    ajiDeleteAudio("audio");
    if (count == 0) {
      await ajiAddAudio("audio", "audio1");
    }
    if (count == 90) {
      await ajiAddAudio("audio", "audio2");
    }
  }
  if (count == 1 || count == 91) {
    ajiPlayAudio("audio");
  }
  count++;
  if (count >= 180) {
    count = 0;
  }
}
